import React, { Component } from 'react';
import ReactTable from "react-table";
import "react-table/react-table.css";

class Data extends Component {

  render() {
    const data = [{
      title: 'Roy Agasthyan',
      des: 26,
      lang: ''
    },{
      title: 'Sam Thomason',
      des: 22,
      lang: ''
    },{
      title: 'Michael Jackson',
      des: 36,
      lang: ''
    },{
      title: 'Samuel Roy',
      des: 56,
      lang: ''
    },{
      title: 'Rima Soy',
      des: 28,
      lang: ''
    },{
      title: 'Suzi Eliamma',
      des: 28,
      lang: ''
    }]

    const columns = [{
      Header: 'Title',
      accessor: 'title'
    },{
      Header: 'Description',
      accessor: 'des'
    },{
        Header: 'Language',
        accessor: 'lang'
      }]

    return (
          <div>
          <h2> My Github Repositories</h2>
              <ReactTable
                data={data}
                columns={columns}
                defaultPdesSize = {3}
                pdesSizeOptions = {[3, 6]}
              />
          </div>      
    )

  }
}


  export default Data;
